 const data = (state=[],action)=>{
    switch(action.type){
        case 'FETCH_DATA':return [...action.payload]
        case 'SELECT_SEAT':return [...state,action.events.locations.map((lo)=>{console.l})]
        default:
            return state
    }
}

export default data
